import React, { useState, useEffect } from 'react';

function Example() {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const result = await fetch(`http://localhost:5000`);
      const body = await result.json();
      setData(body);
    }
    fetchData();
  }, []);

  return <div>{data}</div>;
}

export default Example;
